//import React for Creating components
import React from "react";
//import List component
import List from "./components/List";
//import list icon
import listSvg from "./assets/list.svg";

function App() {
  return (
    <div className="todo">
      {/* sidebar block */}
      <div className="todo__sidebar">
        <List
          items={[
            { icon: <img src={listSvg} alt="list icon" />, name: "All Tasks" },
          ]}
        />
        <List
          items={[
            { color: <img src={listSvg} alt="list icon" />, name: "purchases" },
          ]}
        />
      </div>
      {/* tasks block */}
      <div className="todo__tasks"></div>
    </div>
  );
}

export default App;
